import React from 'react'
import{
    MDBNavbar,
    MDBNavbarBrand,
    MDBCollapse,
    MDBNavbarNav,
    MDBNavItem,
}
 from "mdbreact";

function NavBar()  {
    return (
        <div>
            <NavBar>
        <MDBNavbar color="indigo" dark expand="md">
        <MDBNavbarBrand>
        <strong className="white-text">Shipping Box</strong>
        </MDBNavbarBrand>
        <MDBCollapse id="navbarcollapse3" navbar>
            <MDBNavbarNav right>
            <MDBNavItem >
            </MDBNavItem>
            </MDBNavbarNav>
        </MDBCollapse>
        </MDBNavbar>
        </NavBar>
        </div>
    );
}
export default NavBar;
